// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

contract AceToken {
    uint256 public totalSupply;
    string public name = "AceToken";
    string public symbol = "ACE";
    string public standard = "Ace Token v1.0";
    uint256 public decimals = 18;

    // events
    event Transfer(address indexed _from, address indexed _to, uint256 _value);
    event Approval(
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );

    // mappings
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    constructor(uint256 _initialSupply) {
        // set total supply
        totalSupply = _initialSupply;
        // owner will have all supply at first
        balanceOf[address(this)] = _initialSupply;
    }

    function transfer(address _to, uint256 _value)
        public
        returns (bool success)
    {
        require(
            balanceOf[address(this)] >= _value,
            "You do not have sufficient funds"
        );
        balanceOf[address(this)] -= _value;
        balanceOf[_to] += _value;
        emit Transfer(address(this), _to, _value);
        return true;
    }

    function approve(address _spender, uint256 _value)
        public
        returns (bool success)
    {
        // allow account to how much value is approved
        allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) public returns (bool success) {
        require(_value <= balanceOf[_from], "Value is less in @token");
        require(
            _value <= allowance[_from][msg.sender],
            "Allowance value is less in @token"
        );

        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;

        allowance[_from][msg.sender] -= _value;

        emit Transfer(_from, _to, _value);
        return true;
    }
}

contracts/Lottery.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;


contract Lottery {
    address public manager;
    address[] public players;
    uint256 public entryFee = 0.1 ether;

    address winner;

    uint256 public _end;

    uint256 public time = block.timestamp;

    // enums
    enum LotteryStatus {
        START,
        STARTED,
        ENDED
    }

    // events
    event WinnerDeclared(address winner, uint256 winningPrice);

    LotteryStatus public status = LotteryStatus.START;

    constructor(address _manager) {
        manager = _manager;
    }

    // get all players
    function getPlayers() public view returns (address[] memory) {
        return players;
    }

    // start the lottery
    function start(uint256 _timeInMinutes) public {
        require(
            status == LotteryStatus.START,
            "lottery has already been started or ended."
        );

        status = LotteryStatus.STARTED;

        // time for lottery
        _end = block.timestamp + (_timeInMinutes * 60);
    }

    // enter the lottery
    function enter() public payable {
        require(_end >= uint256(block.timestamp), "time is up.");
        require(!isParticipate(msg.sender), "you are already a participant");
        require(msg.value >= entryFee, "entry fee is less then 0.1 ether");
        require(
            status == LotteryStatus.STARTED,
            "lottery has not started or its ended."
        );

        players.push(msg.sender);
    }

    function isParticipate(address _participant) private view returns (bool) {
        for (uint256 i = 0; i < players.length; i++) {
            if (players[i] == _participant) {
                return true;
            }
        }
        return false;
    }

    // get random
    function random() private view returns (uint256) {
        return
            uint256(
                keccak256(
                    abi.encodePacked(block.difficulty, block.timestamp, players)
                )
            );
    }

    function end() public {
        require(
            block.timestamp >= _end,
            "you can not end lottery before time."
        );
        status = LotteryStatus.ENDED;

        require(players.length > 0, "0 participants");
        uint256 winnerIndex = random() % players.length;
        winner = players[winnerIndex];
        uint256 priceMoney = winningPrice();

        // transfer everything to winner;
        payable(winner).transfer(address(this).balance);

        // reset players.
        players = new address[](0);

        // winner declared event;
        emit WinnerDeclared(winner, priceMoney);
    }

    function getRemainingTime() public returns (uint256) {
        if (_end <= uint256(block.timestamp)) {
            end();
            return 0;
        } else {
            // require(_end >= block.timestamp, "time is already up");
            require(
                !(status == LotteryStatus.ENDED),
                "lottery is not started or its ended."
            );

            return _end - block.timestamp;
        }
    }

    function getWinner() public view returns (address) {
        return winner;
    }

    // get winning price
    function winningPrice() public view returns (uint256) {
        return address(this).balance;
    }
}

contracts/LotteryPool.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;


import "./Lottery.sol";

contract LotteryPool {
    struct lotteryStruct {
        Lottery lotteryContract;
        address manager;
        uint256 endedTimeStamp;
    }

    // map lottery address to lottery info
    mapping(address => lotteryStruct) public lotteriesMapping;

    uint256 public totalLotteries = 0;

    event LotteryCreated(address lotteryAddress);

    address[] public lotteriesContractsAddresses;

    address public manager;

    constructor() {
        manager = msg.sender;
    }

    modifier isOwner() {
        require(manager == msg.sender, "action requires Owner/manager");
        _;
    }

    function createLottery(uint256 _timeInMinutes) public {
        // create lottery instance & send the sender's address
        Lottery localLottery = new Lottery(msg.sender);

        // start the lottery
        localLottery.start(_timeInMinutes);

        // save the lottery in lotteries
        lotteriesMapping[address(localLottery)] = lotteryStruct(
            localLottery,
            msg.sender,
            block.timestamp + (_timeInMinutes * 60)
        );

        // increase lottery count.
        totalLotteries += 1;

        emit LotteryCreated(address(localLottery));

        // save lottery address
        lotteriesContractsAddresses.push(address(localLottery));
    }

    // will return all lotteries
    function getLotteryContractDetails()
        public
        view
        returns (lotteryStruct[] memory)
    {
        lotteryStruct[] memory ret = new lotteryStruct[](totalLotteries);

        for (uint256 i = 0; i < totalLotteries; i++) {
            ret[i] = lotteriesMapping[lotteriesContractsAddresses[i]];
        }

        return ret;
    }

    // get lotteries
    function getLotteries() public view returns (address[] memory) {
        return lotteriesContractsAddresses;
    }
}

