// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;


interface IDepositContract {
    function deposit(
        bytes calldata pubkey,
        bytes calldata withdrawal_credentials,
        bytes calldata signature,
        bytes32 deposit_data_root
    ) external payable;
}

contract StakingPool {
    mapping(address => uint) public balances;
    mapping(bytes => bool) public pubkeysUsed;
    IDepositContract public depositContract = IDepositContract(0x00000000219ab540356cBB839Cbe05303d7705Fa);
    address public admin;
    uint public end;
    bool public finalized;
    uint public totalInvested;
    uint public totalChange;
    mapping(address => bool) public changeClaimed;

    event NewInvestor (
        address investor
    );

    constructor() {
        admin = msg.sender;
        end = block.timestamp + 7 days;
    }

    function invest() external payable {
        require(block.timestamp < end, 'too late');
        if(balances[msg.sender] == 0) {
            emit NewInvestor(msg.sender);   
        }
        balances[msg.sender] += msg.value;
    }

    function finalize() external {
      require(block.timestamp >= end, 'too early');
      require(finalized == false, 'already finalized');
      finalized = true;
      totalInvested = address(this).balance;
      totalChange = address(this).balance % 32 ether;
    }

    function getChange() external {
      require(finalized == true, 'not finalized');
      require(balances[msg.sender] > 0, 'not an investor');
      require(changeClaimed[msg.sender] == false, 'change already claimed');
      changeClaimed[msg.sender] = true;
      uint amount = totalChange * balances[msg.sender] / totalInvested;
      payable(msg.sender).transfer(amount);
    }

    function deposit(
        bytes calldata pubkey,
        bytes calldata withdrawal_credentials,
        bytes calldata signature,
        bytes32 deposit_data_root
    )
        external
    {
        require(finalized == true, 'too early');
        require(msg.sender == admin, 'only admin');
        require(address(this).balance >= 32 ether);
        require(pubkeysUsed[pubkey] == false, 'this pubkey was already used');
        depositContract.deposit{value: 32 ether}(
            pubkey, 
            withdrawal_credentials, 
            signature, 
            deposit_data_root
        );
    }
}

contracts/TokenSale.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;


import "./AceToken.sol";

contract TokenSale {
    address payable admin;
    AceToken public tokenContract;
    uint256 public tokenPrice;
    uint256 public tokenSold;

    event Sell(address _buyer, uint256 _amount);

    modifier isAdmin() {
        require(msg.sender == admin, "You are not the owner");
        _;
    }

    constructor(AceToken _contract, uint256 _tokenPrice) {
        admin = payable(msg.sender);
        tokenContract = _contract;
        tokenPrice = _tokenPrice;
    }

    function buyTokens(uint256 _numberOfTokens) public payable {
        require(msg.value >= _numberOfTokens * tokenPrice, "Price is less");
        require(
            tokenContract.balanceOf(address(tokenContract)) >= _numberOfTokens,
            "Available tokens are less"
        );
        require(
            tokenContract.transfer(msg.sender, _numberOfTokens),
            "Transfering is failed"
        );

        tokenSold += _numberOfTokens;

        emit Sell(msg.sender, _numberOfTokens);
    }

    function endSale() public isAdmin {
        // get balance of this Contract
        uint256 balance = tokenContract.balanceOf(address(tokenContract));
        require(
            tokenContract.transfer(admin, balance),
            "Transfering is failed"
        );
    }
}

contracts/Transactions.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;



contract Transactions {
    uint256 public transactionCount;
    event Transfer(address from, address receiver, uint amount, string message, uint256 timestamp);

    struct TransferStruct {
        address sender;
        address payable receiver;
        uint amount;
        string message;
        uint256 timestamp;
    }

    TransferStruct[] public transactions;

    function addTransaction(address payable receiver, uint amount, string memory message) public {
        transactionCount += 1;
        transactions.push(TransferStruct(msg.sender, receiver, amount, message, block.timestamp));

        emit Transfer(msg.sender, receiver, amount, message, block.timestamp);
    }

    function getTransactions() public view returns(TransferStruct[] memory) {
        return transactions;
    }

}

